import React from 'react';
//import './style/LateralMenu.css';

class LateralMenu extends React.Component{
	getDivStyle = () => {
		return {
			float: 'left',
			background: '#4682B4',
			padding: '10px',
			width: '25%',
			height: '100vh',

			// changing fonts...
			color: '#F0F8FF',
			fontFamily: "verdana",
			fontWeight: 'bold',
			fontSize: '12px'
		}
	}

	getPStyle = () => {
		return{
			background: '#FFFFFF',
			color: '#4682B4'
		}
	}

	render(){
		return(
			<div style={this.getDivStyle()}>
				<p onMouseOver={this.getPStyle()}>COMPANIES</p>
				<p>USUÁRIOS</p>
				<p>RESETAR SENHA</p>
				<p>SIMULAÇÃO</p>
			</div>
		);
	}
}

export default LateralMenu;
